    def saveFile(self, datasets):
        try:
            df = datasets
            self.saveFileName, _ = QFileDialog.getSaveFileName(None, "Save", "", "Text File (*.txt)")
            with open(self.saveFileName, 'w') as f:
                for line in df:
                    f.write("%s\n" % line)
        except FileNotFoundError:
            pass
        
